function App() {
	console.log(AlexaImage, CortanaImage, SiriImage)
	return (
		<div>
			<div>Personal Digital Assistants</div>
			<ProfileCard title="Alexa" handle="@alexa99"img="AlexaImage"/>
			<ProfileCard title="Cortana" handle="@cortana22"img="CortanaImage"/>
			<ProfileCard title="Siri" handle="@Siri01"img="SiriImage"/>
		</div>
	)
}

export default App;
